const React = require("react");
const ScratchStorage = require("scratch-storage");
const BlockType = require("../../extension-support/block-type");
const Runtime = require("../../engine/runtime");

class Cool extends React.Component {
    constructor(props) {
        super(props);

        console.log("constructor props", props);

        this.state = {
            name: props.name,
        };
    }

    componentDidMount() {
        console.log("componentDidMount this.props", this.props);
    }

    componentDidUpdate(newProps, newState, snapshot) {
        console.log(
            "componentDidUpdate newProps",
            newProps,
            "newState",
            newState
        );
    }

    render() {
        console.log("render this.props!", this.props);
        return "COOL!";
    }
}

const neat = function (props) {
    console.log("render props", props);
    return "NEAT!";
};

class ReactExtension {
    /**
     *
     * @param {Runtime} runtime
     */
    constructor(runtime) {
        this.runtime = runtime;
    }

    getInfo() {
        return {
            id: "react",
            name: "React",
            blocks: [
                {
                    opcode: "reactClass",
                    blockType: BlockType.REPORTER,
                    text: "react class [name]",
                },
                {
                    opcode: "reactFunction",
                    blockType: BlockType.REPORTER,
                    text: "react function",
                },
                {
                    opcode: "something",
                    blockType: BlockType.REPORTER,
                    text: "something",
                },
            ],
        };
    }

    reactClass(args) {
        return React.createElement(Cool, { name: args.name }, null);
    }

    reactFunction() {
        return neat;
    }

    something(args, info, block) {
        console.log("args, info, block", { args, info, block });
        // console.log('this', this);
        // console.log('target', info.thread.target);
        // console.log('getCostumes', info.thread.target.getCostumes());

        const storage = info.thread.blockContainer.runtime.storage; // new ScratchStorage();
        console.log("storage", storage, "ScratchStorage", ScratchStorage);

        const bin =
            info.sequencer.runtime.v2BitmapAdapter.convertDataURIToBinary(
                "data:image/png;base64,"
            );
        console.log("bin", bin);

        const asset = storage.createAsset(
            ScratchStorage.AssetType.ImageBitmap,
            "png", // ScratchStorage.DataFormat.PNG,
            bin,
            null,
            true // generate md5
        );
        console.log("asset", asset);

        let ok = info.thread.target.addCostume(asset.assetId, 2);
        console.log("ok", ok);

        info.thread.target.setCostume(2);

        return 10;
    }
}

module.exports = ReactExtension;
